// factory sol is deployed to the net, campaign sol is compiled but not deployed to net yet
// this script = return the factory instance for future use

import web3 from "./web3";
import CampaignFactory from "./build/DataLabellingFactory.json";

const instance = new web3.eth.Contract(
  CampaignFactory.abi,
  "0x08faFFB3876912cb351083110E913F3A27a848bb" //deployed factory address
);

export default instance;
